import React, { Component } from "react";

const App = () => {
	return (
		<React.Fragment>
			<h1>Hello World</h1>
			<h2>This is the list of all the animals</h2>
         <ul>
            <li>venu</li>
            <li>v</li>
         </ul>
		</React.Fragment>
	);
};

export default App;
